Uma das principais peças do sistema de suspensão, o amortecedor é responsável por manter os pneus em contato com o solo. É ele quem garante a estabilidade do automóvel e oferece uma boa dirigibilidade ao motorista. Confira abaixo sinais de que o item pode estar com problemas e precisa ser revisado:

- Barulho (metálicos) e solavancos;
- Falta de estabilidade;
- Aumento na distância de frenagem;
- Desgaste irregular do pneu e;
- Balanços excessivos na carroceria.

A vida útil do amortecedor depende das condições de uso do automóvel, portanto é recomendado que a cada 10.000 quilômetros seja feita uma revisão preventiva.

